var timkiem={lists:[]},buildListHeader=[];function getData(){$.ajax({url:AppURL.kiemtra,type:"GET",dataType:"json",cache:!0,complete:function(t){var e=t.responseJSON.data_searchresult;e.bgimg&&setTimeout(function(){$("body").css({"background-image":"url("+e.bgimg+")"})},200)}})}function doSearch(t){$.ajax({url:AppURL.kiemtra+t,type:"GET",dataType:"json",cache:!0,complete:function(t){var e=t.responseJSON.data_searchresult;timkiem.columnTitle=e.columnTitle.split(","),timkiem.lists=e.lists;var i=t.responseJSON.data_searchresult;i.imgs&&setTimeout(function(){$("body").css({"background-image":"url("+i.imgs+")"})},200),buildHeader(),buildLists(timkiem.lists)}})}function getSearch(){if(!$("#se").val())return alert("Vui lòng nhập từ khóa tìm kiếm"),!1;$(".wheels, #getnumautosop").hide(),$(".boxnone").show(),doSearch($("#se").val())}function buildHeader(){buildListHeader.push('<th scope="col">STT</th>');for(var t=0;t<timkiem.columnTitle.length-2;t++)buildListHeader.push('<th scope="col">'+timkiem.columnTitle[t+2]+"</th>")}function goback(){window.location="./kiemtra.html"}function buildLists(t){$(".boxnone").hide(),$(".resultbox").show(),$(".msdt").html(timkiem.lists.length);for(var e=[],i=0;i<timkiem.lists.length;i++){var s=[];s.push("<td>"+(i+1)+"</td>");for(var a=0;a<timkiem.columnTitle.length-2;a++)s.push("<td>"+timkiem.lists[i].split(";")[a+2]+"</td>");var l="<tr>"+s+"<tr>";e.push(l)}$(".table-kienlong thead tr").html(buildListHeader),$(".table-kienlong tbody").append(e)}getData();